@Test
  public void prependTo_prependsProperSql() {
    /* Given */
    DeleteImpl delete = new DeleteImpl();
    RawSqlBuilder builder = new RawSqlBuilderImpl();

    /* When */
    delete.prependTo(builder);

    /* Then */
    assertThat(builder.toString(), is("DELETE"));
  }

